import React, { Component } from 'react';
import EmployeeItem from './EmployeeItem';

export class EmployeeList extends Component {
  render() {
    return (
      <div>
        <EmployeeItem employees={this.employees} />
      </div>
    );
  }
}

export default EmployeeList;
